const Internships = () => {
  return (
    <div style={{ minHeight: '80vh', backgroundColor: '#111', color: '#fff', padding: '2rem' }}>
      <h1 style={{ color: '#ff6600', fontSize: '2.5rem', marginBottom: '1rem' }}>Internship Experience</h1>
      <h3 style={{ color: '#fff' }}>Research Intern, IEEE SPS Summer Mentorship Program 2025</h3>
      <p style={{ color: '#ccc', fontSize: '1.2rem', lineHeight: '1.8' }}>
        Worked under Dr. Mita C. Paunwala on “Deep Learning-Based Brain Tumor Segmentation using Multi-Modal MRI Data.”<br/>
        Validated model on ethically collected MRI data from GMERS Hospital Gotri, confirming strong generalization to real-world clinical scans.<br/>
        Produced calibrated and post-processed segmentation outputs suitable for research and clinical visualization.<br/>
        <a href="#" style={{ color: '#ff6600' }}>Link</a>
      </p>
    </div>
  );
};

export default Internships;
